import React,{useEffect} from 'react';
import movies from './api/movies';

const App = () => {
    useEffect(()=>{
        const loadMovies=async()=>{
            const response=await movies.get();
            console.log(response);
        }
    },[])
  
    return (
        <div>
            App
        </div>
    )
}

export default App
